import React, { Component } from "react";

export default class Person extends Component {
  addPerson = () => {};
  render() {
    return (
      <div>
        <h2>我是Person组件</h2>
        <input type="text" placeholder="请输入名字" />
        &nbsp;
        <input type="text" placeholder="请输入年龄" />
        <br />
        <br />
        <button onClick={this.addPerson}>点我添加人员</button>
      </div>
    );
  }
}
